import { gql } from "@apollo/client";

export const CREATE_USER = gql`
    mutation createUser(
            $username: String
            $email: String
            $password: String
            $firstName: String
            $lastName: String
            $created: String
            $isActive: Boolean
        ) {
            createUser(
                firstName: $firstName
                lastName: $lastName
                username: $username
                password: $password
                email: $email
                created: $created
                isActive: $isActive
            ) {
                id
                username
                lastName
                firstName
                created
                email
                isActive
            }
        }

`;

export const CREATE_REVIEW = gql`
    mutation {
        createReview(
            description: $description
            created: $created
            movieId: $movieId
            authorId: $authorId
            rating: $rating
        ) {
            description
        }
    }
`;
